import React from "react";
import "./ChatRoom.css";

class ChatRoom extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div className="chatroom">
        <div className="row">
          <div className="col">
            <p className="">
              Kasih aku nasihat kawan agar aku menjadi pribadi yang lebih baik
            </p>
          </div>
        </div>
      </div>
    );
  }
}

export default ChatRoom;
